<script>
    function *malli(){
        yield 100;
        yield 200;
        yield 300;
        return "welcome";
        yield 400;
    };
    let cursor =malli();
    console.log(cursor.next());
    console.log(cursor.next());
    console.log(cursor.next());
    console.log(cursor.next());
    console.log(cursor.next());
    console.log(cursor.next());
</script>
